import { BrowserRouter, Route } from "react-router-dom";
import { HomePage } from "./HomePage/HomePage";
import { Login } from "./Login/Login";

const App = () => {
  return (
    <BrowserRouter>
    <switch>

    </switch>
    <Route exact path="/HomePage/HomePage">
      <HomePage />
    </Route>
    <Route exact path="/Login/Login">
      <Login />
    </Route>
    </BrowserRouter>
  );
};

export { App };
